import React from 'react'
import { Box,Button,Typography } from "@mui/material";
import PhoneIcon from '@mui/icons-material/Phone';

const Main = () => {
  return (
    <Box>
        <Box sx={{display:'flex',justifyContent:'center',gap:'10px',marginTop:'20px' }}>
        <PhoneIcon color='success' sx={{marginTop:'5'}}/>
        <Typography variant='h6' color='success' sx={{textAlign:'center'}}>7030 300 400</Typography>
        <Typography variant='h6' color='success' >Or</Typography>
        <Button variant='outlined' color='success'>Get a callback</Button>
        </Box>
      
    </Box>
  )
}

export default Main
